import React from 'react';
import { Link } from 'react-router-dom';

function NavBar({ onLogoClick, onProfileClick, isLoggedIn, currentView }) {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/" onClick={onLogoClick}>
          Your Logo
        </Link>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            {isLoggedIn && currentView !== 'login' && ( // Check isLoggedIn and currentView
              <li className="nav-item">
                <Link className="nav-link" to="/profile" onClick={onProfileClick}>
                  Profile
                </Link>
              </li>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
